import "./MemoryList.css";

function MemoryListItem({ item }) {
  const { img, option, title, content, badges, memories, like } = item;

  return (
    <div>
      <img src={img} alt={title} />
      <div>{option}</div>
      <div>{title}</div>
      <div>{content}</div>
      <div>획득배지{badges}</div>
      <div>추억{memories}</div>
      <div>그룹 공감{like}</div>
    </div>
  );
}

function MemoryList({ items }) {
  return (
    <ul className="MemoryList">
      {items.map((item) => (
        <li key={item.id}>
          <MemoryListItem item={item} />
        </li>
      ))}
    </ul>
  );
}

export default MemoryList;
